sys_script_include.script:
var SNLiteTemplateAJAX = Class.create();
SNLiteTemplateAJAX.prototype = Object.extendsObject(AbstractAjaxProcessor, {

	getTemplate: function () {
		var templateRec = new GlideRecord("sp_ng_template");
		templateRec.addEncodedQuery("id=snlite-template");
		templateRec.query();

		if (templateRec.next()) {
			return templateRec.getValue("template");
		}
	},

	type: 'SNLiteTemplateAJAX'
});
